import React, { useEffect, useState } from "react";
import  {Form, Button } from 'react-bootstrap';
import axios from "axios";
import app from "../componentes/app.json";
import {isNull} from "util";
import Cookies from "universal-cookie";
import calculaExtraccionSesion from '../componentes/helper/helper';

function Login() {
  const [usuario, setUsuario] = useState("")
  const [password, setPassword] = useState("")

  return (
    <form>
      <div>What is your name?</div>
      <input type="text" value={usuario} onChange={ev => setUsuario(ev.target.value)} />
      <input type="text" value={password} onChange={ev => setPassword(ev.target.value)} />
      <p>{usuario}</p>
      <p>{password}</p>
    </form>
  )
}
export default Login;
